import React from 'react' 

const Landing = (props) => {

    return (
        <div className="get-started">
            <div className="center-element text-center">
            <h1 className="display-2 text-danger">Welcome to Lifelines!</h1>

            <p>Check out the appeals via the nav to see how you can help.</p>
            </div>
        </div>
    )
}

export default Landing
